import React from "react";

function Student(props) {
  const interest = props.interests.forEach((interest) => {
    <li>{interest}</li>;
  });

  return (
    <div>
      <h2>
        {props.name.first} {props.name.last}
      </h2>
      <p>
        <h5>
          <strong>{props.major}</strong>
        </h5>
      </p>
      <p>
        {props.name.first} is taking {props.numCredits} and is
        {props.fromWisconsin ? (
          <p> from Wisconsin </p>
        ) : (
          <p> not from Wisconsin </p>
        )}
      </p>

      <p>
        They have {props.interests.length} interests including...
        <ul>
          {props.interests.forEach((interest) => {
            <li>interest</li>;
          })}
        </ul>
      </p>
    </div>
  );
}

export default Student;
